import React from 'react';
import { NavLink } from 'react-router-dom';
const Naviger = () => {
    return (
        <div>
            <button type="button" class="btn btn-primary">Accueil</button>   <li>  <NavLink to='/'>Accueil</NavLink> <br /> </li>
            <li><NavLink to='/create'>Create</NavLink><br /></li>
            <li><NavLink to='/update'>Update</NavLink><br /></li>
            <li><NavLink to='/delete'>Delete</NavLink></li>


        </div>
    );
};

export default Naviger;
